query findManyDashboards($cursor: DashboardsWhereUniqueInput, $distinct: [DashboardsScalarFieldEnum!], $orderBy: [DashboardsOrderByWithRelationAndSearchRelevanceInput!], $skip: Int, $take: Int, $where: DashboardsWhereInput){
